def test_openssl_aes256cbc_decrypt_1():
  assert_equal(openssl_aes256cbc_decrypt(b'Salted__\x00\x00\x00\x00\x00\x00\x00\x00=\xb05\x7f\xe2\x80\x11q|\nP\xa2\x17\x83\x9c\xa7', b"secret"), b"message")
def test_openssl_aes256cbc_decrypt_2():
  assert_equal(openssl_aes256cbc_decrypt(b'Salted__\x01\x01\x01\x01\x01\x01\x01\x01\r\x80\xf8\x15l\xa9+n\xab\xae\xe0\x9a\xb2I 7WR\xb0\x98\xcc\xfc\xae>\xe0}\x16vmo\xce\x90A_\x83\xbe\xea\xeaP\xdcl\x8e\xaf\x8b\xa2\x17>\x86', b"password"), b"The quick brown fox jumps over the lazy dog")
def test_openssl_aes256cbc_decrypt_3_nosalt():
  assert_equal(openssl_aes256cbc_decrypt(b'\x06\x83\x03\x8a\xa1\x1f\x8b\x76\xa8\x89\x5c\x67\x24\x6e\xb5\x40\x46\x26\xac\x33\xa0\x09\x18\xcd\xa2\xf9\x64\x1c\xd7\x05\x64\xdc\x8d\x4b\xb5\x44\xc3\x4a\x2f\xea\x77\x47\xc1\xa5\xfe\x7c\x6b\xe6', b"password"), b"The quick brown fox jumps over the lazy dog")
def test_openssl_aes256cbc_decrypt_5_nosalt_bytelist():
  assert_equal(openssl_aes256cbc_decrypt(list(b'\x06\x83\x03\x8a\xa1\x1f\x8b\x76\xa8\x89\x5c\x67\x24\x6e\xb5\x40\x46\x26\xac\x33\xa0\x09\x18\xcd\xa2\xf9\x64\x1c\xd7\x05\x64\xdc\x8d\x4b\xb5\x44\xc3\x4a\x2f\xea\x77\x47\xc1\xa5\xfe\x7c\x6b\xe6'), list(b"password")), b"The quick brown fox jumps over the lazy dog")
def test_openssl_aes256cbc_decrypt_6_nosalt_iter():
  def iter(it):
    for _ in it: yield _
  assert_equal(openssl_aes256cbc_decrypt(iter(b'\x06\x83\x03\x8a\xa1\x1f\x8b\x76\xa8\x89\x5c\x67\x24\x6e\xb5\x40\x46\x26\xac\x33\xa0\x09\x18\xcd\xa2\xf9\x64\x1c\xd7\x05\x64\xdc\x8d\x4b\xb5\x44\xc3\x4a\x2f\xea\x77\x47\xc1\xa5\xfe\x7c\x6b\xe6'), b"password"), b"The quick brown fox jumps over the lazy dog")
def test_openssl_aes256cbc_decrypt_7_len16():
  assert_equal(openssl_aes256cbc_decrypt(b"\x53\x61\x6c\x74\x65\x64\x5f\x5f\x34\x60\xf5\xce\xf2\xd8\xac\x5e\x4a\xbc\x34\x1b\xa7\x4a\xc7\x3f\x2d\xa9\x35\x6f\xb8\x67\xde\x4b\xd4\x45\x76\xfe\xc0\x21\xc8\x5e\x49\xc1\x86\x98\xfb\xf1\x77\x07", b"password"), b"1234567890123456")
